check.longDescription:
[Source code of released version](https://github.com/meteor/meteor/tree/master/packages/check) | [Source code of development version](https://github.com/meteor/meteor/tree/devel/packages/check)
***

`check` is a lightweight package for argument checking and general pattern matching. Use it like this:

```
Meteor.publish("chats-in-room", function (roomId) {
  // Make sure roomId is a string, not an arbitrary mongo selector object.
  check(roomId, String);
  return Chats.find({room: roomId});
});

Meteor.methods({addChat: function (roomId, message) {
  check(roomId, String);
  check(message, {
    text: String,
    timestamp: Date,
    // Optional, but if present must be an array of strings.
    tags: Match.Optional([String])
  });

  // ... do something with the message ...
}});
```

For more details see the [`check` section](http://docs.meteor.com/#check_package) of the Meteor docs.

tmeasday:check-npm-versions.longDescription:
Enforces "peer" npm dependencies in Meteor 1.3 Atmosphere packages.

Use this package if you are writing an Atmosphere package that depends on a given npm package is installed at the app level of projects you are installed in.

For example, if you are depending on a npm-distributed React component, you don't want to `Npm.depends()` on the npm package in your Atmosphere package, as this will mean a second copy of React will be shipped client-side as a sub-dependency of your package. Instead, you can do:

```js
import { checkNpmVersions } from 'meteor/tmeasday:check-npm-versions';
checkNpmVersions({
  'griddle-react': '0.3.x'
}, 'my:griddle-package');

const Griddle = require('griddle-react');
```

This will prompt the user with an warning message if they do not install `griddle-react` at a correct version directly in their application. If they install no version at all, your `require` statement will subsequently fail.

In your install instructions, you'll still want to tell them to `npm install --save griddle-react` --- this will just tell them what's wrong if they do not.

Note that you must use `require` rather than `import`, unless you do the check in a separate file, as `import` is hoisted to the top of the file (and thus will error before the call to `checkNpmVersions`, which means the user won't see the helpful warning telling them what to do).

mdg:validated-method.longDescription:
```js
// Method definition
const method = new ValidatedMethod({
  name, // DDP method name
  mixins, // Method extensions
  validate, // argument validation
  applyOptions, // options passed to Meteor.apply
  run // Method body
});

// Method call
method.call({ arg1, arg2 });
```

This is a simple wrapper package for `Meteor.methods`. The need for such a package came
when the Meteor Guide was being written and we realized there was a lot of best-practices
boilerplate around methods that could be easily abstracted away.

> Note: the code samples in this README use the Meteor 1.3 import/export syntax, but this package works great in Meteor 1.2 as well. In that case, we recommend attaching your ValidatedMethod objects to the relevant collection, like `Lists.methods.insert = new ValidatedMethod(...)`.

ostrio:cstorage.longDescription:
-  No external dependencies;
-  Bulletproof persistent Client storage;
-  Support for Unicode values and keys;
-  Support for `String`, `Array`, `Object`, and `Boolean` as values;
-  Works with disabled `localStorage` and `cookies`;
-  __100%__ tests coverage.

